import React, { Component } from "react";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div>
        <table>
          <tbody>
            <tr>
              <td>
                <img width="50" height="50" src="./search.svg" alt="" />
              </td>
              <td width="10" />
              <h1>Movie Digger - The MoviesDB Search</h1>
            </tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default App;
